<p><strong>Những Chuyến Phi&ecirc;u Lưu Nhất Quả Đất - Cuộc Du H&agrave;nh K&igrave; Diệu Của Nils</strong></p>

<p>Bộ truyện&nbsp;<strong>Những chuyến phi&ecirc;u lưu nhất quả đất</strong>&nbsp;gồm 15 truyện thiếu nhi kinh điển thế giới thuộc thể loại cổ t&iacute;ch, phi&ecirc;u lưu c&ugrave;ng&nbsp;<a href="http://tiki.vn/sach-truyen-tieng-viet/sach-van-hoc.html">tiểu thuyết</a>&nbsp;hiện đại&hellip; được thể hiện theo phong c&aacute;ch mới:&nbsp;<a href="http://tiki.vn/truyen-tranh/c1084">truyện tranh</a>&nbsp;minh họa. H&igrave;nh vẽ mỗi cuốn truyện v&ocirc; c&ugrave;ng sinh động, sắc n&eacute;t v&agrave; được vẽ bởi c&aacute;c họa sĩ nổi tiếng ở nhiều quốc gia v&agrave; đoạt nhiều giải thưởng quốc tế.</p>

<p>Về mặt nội dung, bộ truyện được c&aacute;c nh&agrave; văn chuy&ecirc;n nghiệp viết lại với ng&ocirc;n ngữ trong s&aacute;ng, ngắn gọn, dễ hiểu v&agrave; ph&ugrave; hợp với trẻ em. Độc giả nh&iacute; c&oacute; thể t&igrave;m thấy trong bộ truyện những c&acirc;u chuyện cổ t&iacute;ch nổi tiếng đ&atilde; gắn liền với tuổi thơ trẻ em to&agrave;n thế giới như: Đồ bỏ x&oacute;, C&ocirc;ng ch&uacute;a Da Lừa, Ho&agrave;ng tử Ivan v&agrave; s&oacute;i x&aacute;m&hellip;.</p>

<p>Những chuyến phi&ecirc;u lưu kỳ lạ v&ocirc; c&ugrave;ng th&uacute; vị như Gulliver du k&yacute;, 80 ng&agrave;y v&ograve;ng quanh thế giới&hellip;.</p>

<p>Những t&aacute;c phẩm kinh điển dạy cho ch&uacute;ng ta về l&ograve;ng y&ecirc;u thương như: Khu vườn b&iacute; mật, Gừng gắt gỏng, Kh&ocirc;ng gia đ&igrave;nh&hellip;</p>

<p>C&oacute; thể n&oacute;i,&nbsp;<strong>Những chuyến phi&ecirc;u lưu nhất quả đất</strong>&nbsp;sẽ đưa c&aacute;c độc giả nh&iacute; đi khắp nơi, từ c&aacute;c v&ugrave;ng đất xa x&ocirc;i, đến những thế giới kỳ lạ, rồi bay l&ecirc;n bầu trời v&agrave; xuy&ecirc;n qua l&ograve;ng đất; gi&uacute;p c&aacute;c em c&oacute; được trải nghiệm th&uacute; vị, bồi dưỡng tr&iacute; tưởng tượng phong ph&uacute;; b&ecirc;n cạnh đ&oacute; sẽ hiểu hơn về l&ograve;ng y&ecirc;u thương, về t&igrave;nh cảm gia đ&igrave;nh, bạn b&egrave;; gi&uacute;p c&aacute;c em hiểu được l&ograve;ng tin, sự ch&acirc;n th&agrave;nh; nhắc nhở c&aacute;c em về l&ograve;ng tham, sự đố kỵ... Đ&oacute; ch&iacute;nh l&agrave; những điều tuyệt vời để t&acirc;m hồn c&aacute;c em th&ecirc;m s&acirc;u sắc v&agrave; tươi mới.</p>

<p>Một điểm cộng của bộ truyện l&agrave; tr&ograve; chơi &ldquo;C&ugrave;ng l&agrave;m s&aacute;ch bỏ t&uacute;i!&rdquo; v&ocirc; c&ugrave;ng hấp dẫn ở phần cuối truyện. C&aacute;c bạn nhỏ sẽ được trực tiếp tham gia v&agrave;o c&ocirc;ng việc tạo n&ecirc;n một cuốn s&aacute;ch bỏ t&uacute;i cho ri&ecirc;ng m&igrave;nh.</p>

