<p>Nhắc đến Ph&ugrave;ng Qu&aacute;n, người ta sẽ nhớ ngay tới một c&acirc;y b&uacute;t lạ kỳ trong nền văn học Việt Nam với một t&aacute;c phẩm thiếu nhi v&ocirc; c&ugrave;ng ch&acirc;n thực v&agrave; x&uacute;c động về một thế hệ trẻ anh h&ugrave;ng:</p>

<p><strong>Tuổi thơ dữ dội</strong>&nbsp;- cuốn truyện xoay quanh cuộc sống chiến đấu v&agrave; hy sinh của những thiếu ni&ecirc;n 13, 14 tuổi trong h&agrave;ng ngũ Đội thiếu ni&ecirc;n trinh s&aacute;t của trung đo&agrave;n Trần Cao V&acirc;n. Những Lượm, Mừng, Quỳnh sơn ca, H&ograve;a đen, Bồng da rắn, Vịnh sưa, Tư d&aacute;t... mỗi người một ho&agrave;n cảnh song đều chung quyết t&acirc;m, nhiệt huyết v&agrave; l&ograve;ng y&ecirc;u nước, đ&atilde; tham gia chiến đấu hết m&igrave;nh v&agrave; hy sinh khi tuổi đời c&ograve;n rất trẻ.</p>

<p>Đ&uacute;ng như t&ecirc;n truyện, độc giả sẽ bắt gặp ở đ&oacute; những chi tiết thực sự dữ dội về cuộc đời thiếu ni&ecirc;n bất hạnh, về cuộc chiến tranh chống giặc t&agrave;n khốc nhưng ẩn s&acirc;u b&ecirc;n trong ta vẫn thấy những t&acirc;m hồn trong s&aacute;ng v&agrave; v&ocirc; tư, thấy sự can trường, dũng cảm phi thường của nh&acirc;n vật. Tất cả những ai đ&atilde; từng đọc t&aacute;c phẩm n&agrave;y hầu như đều kh&ocirc;ng ngăn được x&uacute;c động v&agrave; những giọt nước mắt cảm thương, cảm phục. Đ&acirc;y thực sự l&agrave; một t&aacute;c phẩm qu&yacute; trong kho t&agrave;ng văn học Việt Nam. Một c&acirc;u chuyện khơi dậy trong mỗi người&nbsp;<a href="http://tiki.vn/tieu-thuyet-tinh-cam-lang-man/c844">t&igrave;nh y&ecirc;u</a>&nbsp;đất nước v&agrave; niềm tr&acirc;n trọng k&yacute; ức tuổi thơ...</p>

<p>C&aacute;c đ&aacute;nh gi&aacute; về t&aacute;c phẩm: &quot;... C&oacute; một vi&ecirc;n ngọc qu&yacute; thời gian d&agrave;nh ri&ecirc;ng để ban tặng con người, đ&oacute; l&agrave; Tuổi thơ. Vi&ecirc;n ngọc m&agrave;u nhiệm, trong s&aacute;ng nhưng qu&aacute; mong manh, kh&ocirc;ng thể t&igrave;m thấy lần thứ hai trong đời. V&agrave; c&oacute; một thế hệ người Việt chưa bao giờ được cầm vi&ecirc;n ngọc tr&ecirc;n tay, Tuổi thơ dữ dội của Ph&ugrave;ng Qu&aacute;n được viết cho thế hệ đ&oacute;. H&atilde;y đọc để nhớ lại, để tự h&agrave;o, v&agrave; để cầu nguyện cho những Tuổi thơ sắp ra đời...&quot;&nbsp;<em><strong>- Nh&agrave; văn Ho&agrave;ng Phủ Ngọc Tường.</strong></em></p>

<p>&quot;... T&ocirc;i đọc v&agrave;o năm đầu Tuổi thơ dữ dội thập kỷ 60, từ những trang tư liệu của Ph&ugrave;ng Qu&aacute;n. Suốt ngh&igrave;n trang s&aacute;ch, khắc s&acirc;u v&agrave;o l&ograve;ng t&ocirc;i hai chữ Trung Hiếu. Một nỗi đau x&eacute; l&ograve;ng khi ta đọc đến lời trăng trối của Mừng, nh&acirc;n vật trong truyện, trước l&uacute;c em đi v&agrave;o c&otilde;i vĩnh hằng...&quot;&nbsp;<em><strong>- Nh&agrave; văn Việt Linh.</strong></em></p>

<p>&quot;... Tuổi thơ dữ dội kh&ocirc;ng phải l&agrave; một c&acirc;u chuyện cổ t&iacute;ch, m&agrave; l&agrave; một c&acirc;u chuyện c&oacute; thật ở chốn trần gian, ở đ&oacute; những con người tuổi nhỏ đ&atilde; tham gia v&agrave;o cuộc kh&aacute;ng chiến chống x&acirc;m lược bảo vệ Tổ quốc với một chuỗi những chiến c&ocirc;ng đầy ắp ly kỳ v&agrave; hấp dẫn. Đọc Tuổi thơ dữ dội ch&iacute;nh l&agrave; đọc lại một phần lịch sử tuổi thơ Việt, thấm đẫm x&uacute;c động, cảm phục v&agrave; tự h&agrave;o...&quot;&nbsp;<em><strong>- Nh&agrave; thơ, nhạc sĩ Nguyễn Trọng Tạo.</strong></em></p>

<p>&ldquo;...S&aacute;ch d&agrave;y gần 800 trang m&agrave; người đọc kh&ocirc;ng bao giờ muốn ngừng lại, bị l&ocirc;i cuốn v&igrave; những nh&acirc;n vật ng&acirc;y thơ c&oacute;, kh&ocirc;n ranh c&oacute;, anh h&ugrave;ng c&oacute;, v&igrave; những sự việc khi th&igrave; li k&igrave;, khi th&igrave; h&agrave;i hước, khi th&igrave; g&acirc;y x&uacute;c động đến ứa nước mắt... T&ocirc;i chỉ mong l&agrave;m sao cho tất cả c&aacute;c em thiếu nhi Việt Nam được đọc s&aacute;ch n&agrave;y.&rdquo;&nbsp;<em><strong>- Nh&agrave; văn h&oacute;a Nguyễn Khắc Viện.</strong></em></p>
