<p><strong>Combo Bộ S&aacute;ch Khổng Lồ Về Cơ Thể Người V&agrave; C&aacute;c Lo&agrave;i Khủng Long (Tặng K&egrave;m 1 Bộ S&aacute;ch 3D)</strong></p>

<ul>
	<li><em><strong>Big Book Of The Body &ndash; Cuốn S&aacute;ch Khổng Lồ Về Cơ Thể Người</strong></em></li>
</ul>

<p>Đ&acirc;y l&agrave; một cuốn s&aacute;ch k&iacute;ch thước lớn, c&oacute; những trang gấp khổng lồ, khơi gợi sự th&iacute;ch th&uacute; cho độc giả, nhất l&agrave; trẻ em. Cuốn s&aacute;ch rất trực quan v&agrave; sinh động, c&oacute; đầy đủ c&aacute;c th&ocirc;ng tin cơ bản nhất về cơ thể người, được tr&igrave;nh b&agrave;y rất khoa học v&agrave; s&aacute;ng tạo: cơ thể được h&igrave;nh th&agrave;nh từ những g&igrave;, bộ xương cấu tạo ra sao, c&aacute;c loại cơ bắp tr&ecirc;n cơ thể người, hệ tuần ho&agrave;n, hệ h&ocirc; hấp, hệ ti&ecirc;u h&oacute;a, bộ n&atilde;o v&agrave; c&aacute;c d&acirc;y thần kinh, v&agrave; c&aacute;c số liệu đ&aacute;ng kinh ngạc về cơ thể.</p>

<ul>
	<li><em><strong>Big Book Of Big Dinosaurs - Cuốn S&aacute;ch Khổng Lồ Về C&aacute;c Lo&agrave;i Khủng Long</strong></em></li>
</ul>

<p>Khủng long từng l&agrave; &quot;chủ nh&acirc;n&quot; của Tr&aacute;i Đất. Nhưng cuối c&ugrave;ng, bầy đ&agrave;n h&ugrave;ng mạnh n&agrave;y lại &quot;biến mất&quot; khỏi Tr&aacute;i đất một c&aacute;ch b&iacute; ẩn, con người đ&atilde; t&igrave;m thấy v&ocirc; số h&oacute;a thạch bị ch&ocirc;n v&ugrave;i của ch&uacute;ng.</p>

<p>Nếu bạn t&ograve; m&ograve; về lo&agrave;i vật n&agrave;y, muốn dạo bước trong thế giới nguy&ecirc;n thủy để s&aacute;nh đ&ocirc;i b&ecirc;n cạnh những bạo ch&uacute;a Tyrannosaurus kh&eacute;t tiếng hung tợn, thần sấm Brontosaurus với bước ch&acirc;n rung chuyển mặt đất, hay t&ecirc;n trộm nhỏ b&eacute; m&agrave; ai cũng phải d&egrave; chừng Velociraptor... th&igrave; đ&acirc;y ch&iacute;nh l&agrave; cuốn s&aacute;ch m&agrave; bạn kh&ocirc;ng thể bỏ lỡ.</p>

<p>&nbsp;</p>

