<p>&quot;Trờ chơi tử thần&quot; cuối c&ugrave;ng cũng đến hồi kết.</p>

<p>Một phụ nữ ăn trộm trong si&ecirc;u thị, bị nh&acirc;n vi&ecirc;n cửa h&agrave;ng t&oacute;m được. &Ocirc;ng chủ thương t&igrave;nh giữ c&ocirc; ta ở lại l&agrave;m việc, nhưng dần ph&aacute;t hiện c&ocirc; c&oacute; nhiều điều kh&oacute; hiểu. Một ng&ocirc;i nh&agrave; ẩn trong rừng s&acirc;u, một đứa &quot;con g&aacute;i&quot; b&iacute; ẩn... &Ocirc;ng chủ t&igrave;m c&aacute;ch tiếp cận mới biết c&ocirc; cất giấu một b&iacute; mật kinh ho&agrave;ng. Một nh&agrave; ph&ecirc; b&igrave;nh ẩm thực tiếng tăm t&igrave;nh cơ được thường thức một m&oacute;n ăn b&iacute; mật m&agrave; &ocirc;ng đ&atilde; nếm từ h&agrave;ng chục năm trước. Để t&igrave;m ra sự thật về m&oacute;n ăn n&agrave;y, &ocirc;ng bắt đầu b&iacute; mật điều tra v&agrave; đ&atilde; ph&aacute;t hiện ra một sự thật gh&ecirc; rợn...</p>

<p>Người kể c&acirc;u chuyện trong buổi tối thứ mười ba l&agrave; Chris. Cậu ta n&oacute;i c&acirc;u chuyện của m&igrave;nh l&agrave; c&acirc;u chuyện đặc biệt, cần sự tương t&aacute;c của mọi người. Hơn nữa, dựa v&agrave;o biểu hiện của mọi người trong qu&aacute; tr&igrave;nh tham gia, cậu ta c&oacute; thể đo&aacute;n được ai l&agrave; &quot;người tổ chức&quot;. C&acirc;u chuyện của cậu ta liệu c&oacute; &quot;c&ocirc;ng hiệu&quot; như những g&igrave; m&igrave;nh n&oacute;i?</p>

<p>Nam Thi&ecirc;n &ndash; người cuối c&ugrave;ng sẽ kể c&acirc;u chuyện như thế n&agrave;o? Liệu c&oacute; điều g&igrave; khiến tất cả mọi người đều phải bất ngờ? Ai sẽ l&agrave; người chiến thắng trong tr&ograve; chơi n&agrave;y? Th&acirc;n phận thật sự của &quot;người tổ chức&quot; c&oacute; được ph&aacute; giải? Tất cả sẽ được giải đ&aacute;p v&agrave;o buổi tối thứ mười bốn.</p>
