<p><strong>Cấu h&igrave;nh mạnh mẽ</strong></p>

<p><strong>Apple Macbook 2016 MLHE2 V&agrave;ng</strong>&nbsp;được trang bị bộ vi xử l&yacute; Intel Core M3 1.1GH, RAM 8GB, ổ cứng 256 GB sẽ hỗ trợ bạn giải quyết c&aacute;c c&ocirc;ng việc một c&aacute;ch mượt m&agrave; v&agrave; nhanh ch&oacute;ng.&nbsp;<a href="http://tiki.vn/o-cung-ssd-256gb/c3694">Ổ cứng SSD 256GB</a>&nbsp;n&acirc;ng cao tốc độ truy cập dữ liệu, kh&ocirc;ng g&acirc;y ồn, ti&ecirc;u tốn &iacute;t điện năng, nhiệt độ hoạt động thấp, gi&uacute;p m&aacute;y c&oacute; hiệu suất tốt hơn, thời lượng pin cũng k&eacute;o d&agrave;i. B&ecirc;n cạnh đ&oacute;&nbsp; hệ điều h&agrave;nh&nbsp;Mac OS X&nbsp;với hiệu suất ứng dụng nhanh v&agrave; mượt hơn c&aacute;c bản trước. Mac OS X c&ograve;n được đ&aacute;nh gi&aacute; cao về độ bảo mật th&ocirc;ng tin, độ tin cậy cũng như thiết kế đẹp mắt hơn hệ điều h&agrave;nh Windows.</p>

