<p>T&ocirc; m&agrave;u l&agrave; h&igrave;nh thức k&iacute;ch th&iacute;ch tr&iacute; tưởng tượng cũng như h&igrave;nh th&agrave;nh tư duy cho c&aacute;c b&eacute; mẫu gi&aacute;o. T&ocirc; m&agrave;u gi&uacute;p c&aacute;c b&eacute; l&agrave;m quen với thế giới m&agrave;u sắc, l&agrave;m quen với sự vật trong đời sống hằng ng&agrave;y qua từng trang giấy.<br />
