', 'be-lam-quen-moi-truong---nhac-cu', NULL, 60000, false, 0, '2017-05-09 02:17:38+00', 1, '2017-05-19 19:22:18+00', 1, false, '{vãi,như,gì,á}', '{vai,nhu,gi,a}');

<p>Thị trấn ven biển Beaufort, nơi từ th&aacute;ng Tư ch&iacute; th&aacute;ng Mười trẻ con chạy ch&acirc;n trần tr&ecirc;n phố, nơi người ta vui vẻ ch&agrave;o nhau từ cửa k&iacute;nh &ocirc; t&ocirc; d&ugrave; c&oacute; quen biết hay kh&ocirc;ng. Khi vội v&agrave;ng lướt qua cuốn kỷ yếu để t&igrave;m bạn nhảy tạm cho vũ hội đầu năm, Landon kh&ocirc;ng ngờ rằng c&ocirc; g&aacute;i rụt r&egrave; v&agrave; mờ nhạt cậu chọn sẽ lột x&aacute;c th&agrave;nh thi&ecirc;n thần xinh đẹp trong ng&agrave;y c&ocirc;ng diễn vở kịch Gi&aacute;ng sinh. Nhưng ch&iacute;nh vẻ đẹp đ&iacute;ch thực trong t&acirc;m hồn Jamie m&agrave; Landon ngỡ ng&agrave;ng nhận ra sau những buổi tập kịch, những lần tản bộ về nh&agrave; v&agrave; tr&ograve; chuyện b&ecirc;n h&agrave;ng hi&ecirc;n mới dần khiến cậu phải l&ograve;ng c&ocirc;. Landon v&agrave; Jamie say sưa trong hương vị ngọt ng&agrave;o của&nbsp;<a href="http://tiki.vn/tieu-thuyet-tinh-cam-lang-man/c844">t&igrave;nh y&ecirc;u</a>&nbsp;đầu đời, nhưng chờ đợi ph&iacute;a trước họ l&agrave; một b&iacute; mật chưa kể sẽ khiến cuộc đời họ vĩnh viễn thay đổi.</p>

<p>&quot;Đầu ti&ecirc;n, bạn mỉm cười, rồi sau đ&oacute; bạn sẽ kh&oacute;c - xin đừng tr&aacute;ch t&ocirc;i đ&atilde; kh&ocirc;ng cảnh b&aacute;o trước.&quot;&nbsp;<strong>Nicholas Sparks</strong>&nbsp;bắt đầu cuốn&nbsp;<a href="http://tiki.vn/sach-truyen-tieng-viet/sach-van-hoc/tieu-thuyet-tinh-cam-lang-man.html">truyện tiểu thuyết t&igrave;nh y&ecirc;u</a>&nbsp;của m&igrave;nh bằng lời khẳng định chắc nịch như vậy, để rồi lời tuy&ecirc;n bố ấy x&aacute;c định giọng điệu cho cả c&acirc;u chuyện lay động t&acirc;m can về mối t&igrave;nh đầu v&agrave; thời tuổi trẻ.</p>
', 'doan-duong-de-nho-tai-ban', 'Product/image_path/62-Đoạn-Đường-Để-Nhớ-Tái-Bản.jpg', 120000, false, 0, '2017-05-19 10:24:17+00', 1, '2017-05-19 18:53:15+00', 1, false, '{Đoạn,Đường,Để,Nhớ,Tái,Bản}', '{doan,duong,de,nho,tai,ban}');

<p>T&iacute;nh c&aacute;ch của trẻ được h&igrave;nh th&agrave;nh từ rất sớm, th&ocirc;ng qua sự gi&aacute;o dục trong gia đ&igrave;nh, qua những việc l&agrave;m, lời n&oacute;i, c&aacute;ch ứng xử của những người xung quanh. Nhưng ở độ tuổi nhỏ, kh&ocirc;ng thể &eacute;p trẻ ph&aacute;t triển t&iacute;nh c&aacute;ch theo &yacute; muốn của cha mẹ bằng lời dạy dỗ su&ocirc;ng, bằng những b&agrave;i học đạo đức kh&ocirc; khan, m&agrave; những tấm gương đẹp về t&iacute;nh c&aacute;ch đ&oacute; phải được gieo v&agrave;o trẻ từ từ bằng những c&acirc;u chuyện sinh động, hấp dẫn.</p>

<p>Bộ s&aacute;ch<strong>&nbsp;Gieo mầm t&iacute;nh c&aacute;ch</strong>&nbsp;(12 tập) l&agrave; tập hợp những c&acirc;u chuyện như vậy. Mỗi tập l&agrave; một hạt giống t&iacute;nh c&aacute;ch gieo v&agrave;o trẻ những b&agrave;i học Tử tế, Tha thứ, Ki&ecirc;n tr&igrave;, Thật th&agrave;, Quan t&acirc;m, Y&ecirc;u thương, Mạnh mẽ, Tự tin, Ước mơ, Lịch sự, Hiếu thảo, C&ocirc;ng bằng bằng những c&acirc;u chuyện cảm động, đầy &yacute; nghĩa đ&aacute;ng để suy ngẫm.</p>

<p>Mỗi c&acirc;u chuyện được tr&igrave;nh b&agrave;y k&egrave;m với một c&acirc;u tục ngữ, th&agrave;nh ngữ, ca dao, danh ng&ocirc;n nhằm nhấn mạnh th&ecirc;m th&ocirc;ng điệp m&agrave; người tuyển chọn muốn gửi gắm. Kh&ocirc;ng chỉ vậy, những b&agrave;i học sau mỗi c&acirc;u chuyện được x&acirc;y dựng gần gũi, nhiều gợi mở cho người đọc triển khai th&ecirc;m nhiều suy nghĩ sau khi đọc truyện, so s&aacute;nh, &aacute;p dụng thực tế v&agrave; tự x&eacute;t bản th&acirc;n.</p>

<p>Truyện được minh họa hai m&agrave;u sinh động.</p>

<p><em>&quot;C&oacute; một c&acirc;u chuyện đại &yacute; rằng: Mỗi ng&agrave;y khi l&agrave;m một việc tốt th&igrave; bỏ v&agrave;o lọ một hạt đậu trắng, l&agrave;m một việc xấu th&igrave; bỏ v&agrave;o hạt đậu đen v&agrave;o c&aacute;i lọ b&ecirc;n cạnh, để từ đ&oacute; khi nh&igrave;n v&agrave;o số hạt trong lọ m&agrave; biết nhắc nhở m&igrave;nh l&agrave;m những việc tốt hơn.&quot;</em></p>

<p><em>&quot;Chưa hề c&oacute; ai, kể cả thi sĩ c&oacute; thể đo lường được sức chứa của tr&aacute;i tim.&quot;</em></p>
