<p><strong>Tam Sinh Tam Thế Chẩm Thượng Thư (Tập 2A + 2B) - B&igrave;a Mềm</strong></p>

<p><strong>&ldquo;Tam sinh tam thế - Chẩm thượng thư</strong>&rdquo; nằm trong hệ liệt &ldquo;Tam sinh tam thế&rdquo;, viết về Phượng Cửu (ch&aacute;u g&aacute;i Bạch Thiển) v&agrave; Đ&ocirc;ng Hoa Đế Qu&acirc;n (hai nh&acirc;n vật đ&atilde; xuất hiện trong&nbsp;<strong>&ldquo;Tam sinh tam thế - Thập l&yacute; đ&agrave;o hoa&rdquo;</strong>).<strong>&nbsp;&ldquo;Tam sinh tam thế - Chẩm thượng thư&rdquo;</strong>&nbsp;l&agrave; một c&acirc;u chuyện v&ocirc; c&ugrave;ng hấp dẫn, độc đ&aacute;o v&agrave; đặc sắc. Nếu như tập 1 của cuốn s&aacute;ch đem lại cho c&aacute;c bạn v&ocirc; v&agrave;n nụ cười v&igrave; sự h&agrave;i hước v&agrave; c&oacute; phần &ldquo;qu&aacute;i gở&rdquo; của Đ&ocirc;ng Hoa th&igrave; với tập 2, c&acirc;u chuyện vẫn d&iacute; dỏm như thế, nhưng lại s&acirc;u lắng hơn, x&uacute;c động v&agrave; day dứt hơn.</p>

<p>Dưới ng&ograve;i b&uacute;t t&agrave;i hoa của&nbsp;<strong>Đường Thất C&ocirc;ng Tử</strong>, t&acirc;m l&yacute; nh&acirc;n vật, những chuyển biến trong suy nghĩ, th&aacute;i độ v&agrave; cảm x&uacute;c của từng nh&acirc;n vật hiện l&ecirc;n v&ocirc; c&ugrave;ng sắc n&eacute;t. Đoạn kết vi&ecirc;n m&atilde;n v&agrave; hạnh ph&uacute;c của c&acirc;u chuyện&nbsp;<a href="http://tiki.vn/tieu-thuyet-tinh-cam-lang-man/c844">t&igrave;nh y&ecirc;u</a>&nbsp;&ldquo;tr&aacute;i &yacute; thi&ecirc;n mệnh&rdquo; giữa Đ&ocirc;ng Hoa - Phượng Cửu trong tập 2 n&agrave;y chắc chắn sẽ để lại trong l&ograve;ng bạn đọc nhiều ấn tượng.Chấp niệm suốt hai ngh&igrave;n năm chỉ đổi lại hai chữ v&ocirc; duy&ecirc;n.Nếu chung quy l&agrave; v&ocirc; duy&ecirc;n vậy tại sao lại cho ch&uacute;ng ta gặp nhau, chỉ một lần gặp gỡ m&agrave; vấn vương ngh&igrave;n năm?Trong mộng cảnh tr&ugrave;ng tr&ugrave;ng m&acirc;y m&ugrave; c&oacute; h&igrave;nh b&oacute;ng của ai, hủy diệt nỗi tương tư của ai, ch&ocirc;n v&ugrave;i đời n&agrave;y kiếp trước của ai?</p>

<p>&ldquo;N&agrave;ng muốn g&igrave;?&rdquo;.&ldquo;Mong muốn cả đời ta chỉ l&agrave; được thấy h&igrave;nh b&oacute;ng m&igrave;nh trong mắt ch&agrave;ng m&agrave; th&ocirc;i&rdquo;.</p>

<p>&ldquo;Ch&agrave;ng rất tốt, chỉ l&agrave; ta v&agrave; ch&agrave;ng kh&ocirc;ng c&oacute; duy&ecirc;n m&agrave; th&ocirc;i&rdquo;.&ldquo;Thi&ecirc;n mệnh n&oacute;i c&oacute; duy&ecirc;n th&igrave; sao, v&ocirc; duy&ecirc;n th&igrave; sao, bản qu&acirc;n chưa từng sợ h&atilde;i thi&ecirc;n mệnh, cũng kh&ocirc;ng cần thi&ecirc;n mệnh bố th&iacute;&rdquo;.</p>

<p><strong>&ldquo;Tam sinh tam thế - Chẩm thượng thư&rdquo; tập 2</strong>&nbsp;nhận được rất nhiều y&ecirc;u mến của độc giả:&nbsp;</p>

<p>&quot;D&ugrave;ng ba ng&agrave;y để đọc hai tập s&aacute;ch Tam sinh tam thế Chẩm thượng thư, t&ocirc;i c&oacute; rất nhiều cảm x&uacute;c, muốn viết g&igrave; đ&oacute; nhưng lại kh&ocirc;ng biết viết g&igrave;, chỉ c&oacute; thể n&oacute;i rằng một lần nữa t&ocirc;i lại bị Đường Thất C&ocirc;ng Tử chinh phục.&nbsp;<strong>(Độc giả: villechansons)</strong></p>

<p>Đường Thất l&agrave; một t&aacute;c giả rất xuất sắc, văn của chị vừa h&oacute;m hỉnh khiến người ta bật cười rồi lại đau đớn đến mức l&agrave;m người ta bật kh&oacute;c ngay được.&nbsp;<strong>(Độc giả: Lala)</strong></p>

<p>Tam sinh tam thế Chẩm thượng thư kết th&uacute;c nhanh qu&aacute;, l&agrave;m t&ocirc;i gấp s&aacute;ch lại m&agrave; vẫn c&ograve;n thấy ngơ ng&aacute;c v&agrave; tiếc nuối.&nbsp;<strong>(Độc giả: San Nam)</strong></p>

