<p><strong>Tiểu Thuyết Trinh Th&aacute;m 1/14 - Tập 1 - Tr&ograve; Chơi Tử Thần</strong></p>

<p>Đ&acirc;y l&agrave; một tr&ograve; chơi thử th&aacute;ch tr&iacute; tuệ v&agrave; l&ograve;ng dũng cảm, người thắng cuộc sẽ gi&agrave;nh được phần thưởng v&ocirc; c&ugrave;ng lớn v&agrave; quyền được sinh tồn, c&ograve;n những kẻ vi phạm nguy&ecirc;n tắc tr&ograve; chơi sẽ phải nhận sự trừng phạt ch&iacute;nh l&agrave; c&aacute;i chết.</p>

<p>Mười bốn t&aacute;c giả chuy&ecirc;n viết tiểu thuyết trinh th&aacute;m bị &ldquo;mời&rdquo; đến một nơi b&iacute; mật, những t&igrave;nh huống k&igrave; lạ xảy ra, những sự kiện đ&aacute;ng sợ bất ngờ xuất hiện một c&aacute;ch li&ecirc;n tục, những nh&agrave; văn chuy&ecirc;n viết truyện trinh th&aacute;m cũng kh&ocirc;ng t&agrave;i n&agrave;o l&iacute; giải nổi. C&aacute;i chết lu&ocirc;n r&igrave;nh rập mọi l&uacute;c mọi nơi, kh&ocirc;ng kh&iacute; căng thẳng bao tr&ugrave;m. Khi số người sống s&oacute;t c&agrave;ng ng&agrave;y c&agrave;ng &iacute;t, họ dần nhận ra một &quot;quy luật&quot; v&agrave; b&iacute; mật kinh người&hellip;</p>

<p><strong>Tr&ograve; chơi tử thần</strong>&nbsp;đ&atilde; bắt đầu, kẻ chủ mưu vẫn lẩn khuất xung quanh họ l&agrave; ai? Hắn ta? C&ocirc; ta? Rốt cục c&oacute; mục đ&iacute;ch g&igrave;? Sau mười bốn ng&agrave;y, kẻ c&ograve;n lại liệu c&oacute; sống s&oacute;t v&agrave; tho&aacute;t khỏi nơi quỷ qu&aacute;i đ&oacute; hay kh&ocirc;ng? Liệu sau đ&oacute; c&ograve;n c&oacute; điều g&igrave; đ&aacute;ng sợ hơn chăng? Đ&oacute; lẽ n&agrave;o l&agrave; một tr&ograve; chơi kh&ocirc;ng bao giờ kết th&uacute;c?</p>
