<p>Bộ truyện tranh được thực hiện dựa theo phương ph&aacute;p gi&aacute;o dục Shichida - Nu&ocirc;i dưỡng tr&aacute;i tim v&agrave; t&acirc;m hồn của b&eacute;, sẽ gi&uacute;p ba mẹ truyền đạt những hiểu biết về ph&eacute;p cư xử cơ bản v&agrave; nu&ocirc;i dưỡng t&acirc;m hồn b&eacute; th&ocirc;ng qua qu&aacute; tr&igrave;nh kh&aacute;m ph&aacute; từng trang truyện th&uacute; vị, b&ecirc;n cạnh đ&oacute; c&ograve;n n&acirc;ng cao khả năng đọc, khả năng tưởng tượng v&agrave; năng lực diễn đạt của b&eacute;, v&agrave; cũng l&agrave; một trong những động lực th&uacute;c đẩty t&igrave;nh cảm gắn b&oacute; giữa cha mẹ v&agrave; con c&aacute;i...</p>

