<p><strong>Hy Vọng</strong></p>

<p>Lila Borowa, c&ocirc; g&aacute;i Ba Lan, mồ c&ocirc;i mẹ, bố nh&agrave; n&ocirc;ng, nghiện rượu; Aleksei Dragonow, người Nga, mồ c&ocirc;i cả cha lẫn mẹ sau vụ nổ tại nh&agrave; m&aacute;y điện nguy&ecirc;n tử Chernobyl năm 1986, ở với d&igrave;. Họ gặp nhau do một sự t&igrave;nh cờ ở trong rừng v&agrave; trở th&agrave;nh bạn th&acirc;n khi Lila mới s&aacute;u tuổi, Aleksei t&aacute;m tuổi. &Ocirc;ng Borowy, bố c&ocirc; b&eacute;, kh&ocirc;ng chấp nhận t&igrave;nh bạn n&agrave;y v&agrave; thường giở th&oacute;i bạo h&agrave;nh, lắm phen cho cả hai no đ&ograve;n, đến nỗi Aleksei thề l&agrave; sẽ cứu bạn tho&aacute;t khỏi người bố vũ phu. Chẳng bao l&acirc;u số phận khiến họ phải xa nhau. Những tưởng con đường của họ sẽ chẳng bao giờ gặp nhau, tuy nhi&ecirc;n hai thứ t&igrave;nh cảm mạnh hơn định mệnh đ&atilde; lu&ocirc;n lu&ocirc;n gắn b&oacute; họ:&nbsp;<a href="http://tiki.vn/tieu-thuyet-tinh-cam-lang-man/c844">t&igrave;nh y&ecirc;u</a>&nbsp;v&agrave; l&ograve;ng căm th&ugrave;.</p>

<p>Nhiều năm sau đ&oacute;, dẫu ở c&aacute;ch xa, Aleksei, ch&agrave;ng trai nặng t&igrave;nh nghĩa v&agrave; gi&agrave;u l&ograve;ng bao dung thường xuy&ecirc;n về l&agrave;ng thăm bạn, d&ugrave; mỗi lần như vậy c&ocirc; g&aacute;i Lila chỉ l&agrave;m tổn thương, thậm ch&iacute; x&uacute;c phạm bạn m&igrave;nh: &quot;Mỗi bận anh về l&agrave; một lần em l&agrave;m tổn thương anh, phản bội anh, lừa đảo anh, anh ra đi, chữa trị vết thương, vết thương tr&ecirc;n cơ thể v&agrave; vết thương l&ograve;ng, anh tha thứ - lần n&agrave;o anh cũng tha thứ cho em, rồi anh quay trở lại. Sau một năm, sau hai, ba năm, nhưng lu&ocirc;n lu&ocirc;n quay trở lại. Kh&ocirc;ng hề thay đổi, như mặt trời mọc v&agrave; lặn, như thủy triều l&ecirc;n v&agrave; xuống. V&agrave; em đ&atilde; lợi dụng sự yếu đuối n&agrave;y của anh, vẫn tiếp tục c&agrave;ng ng&agrave;y c&agrave;ng l&agrave;m tổn thương anh&quot;.</p>

<p>Thế nhưng, bản th&acirc;n c&ocirc; g&aacute;i cũng phải k&igrave;m n&eacute;n nỗi đau thể x&aacute;c v&agrave; tinh thần: &quot;Em đ&atilde; nhớ anh như đi&ecirc;n dại&hellip; Em rất lấy l&agrave;m tiếc về sự đ&ecirc; tiện v&agrave; sự nh&aacute;t gan của m&igrave;nh&hellip; Em khinh bỉ ch&iacute;nh m&igrave;nh&hellip; Em lại giam m&igrave;nh trong nh&agrave; tắm, mặc dầu cả nh&agrave; đi vắng, em cầm lưỡi dao cạo v&agrave;&hellip; tự rạch da l&agrave;m cho m&igrave;nh đau, đồng thời kết tội bản th&acirc;n v&igrave; những g&igrave; em đ&atilde; l&agrave;m hại anh, cũng như để l&agrave;m &aacute;t đi nỗi đau mất anh. Sau đ&oacute; em đ&atilde; tự nhổ v&agrave;o mặt m&igrave;nh, để c&agrave;ng th&ecirc;m khinh bỉ c&aacute;i sự h&egrave;n yếu n&agrave;y của em&quot;.</p>

<p>Lila tựa hồ ngọn lửa, c&ograve;n Aleksei như con thi&ecirc;u th&acirc;n. Mối t&igrave;nh lắm gian nan v&agrave; nhiều trắc trở của Lila v&agrave; Aleksei cũng l&agrave; định mệnh v&agrave; lời nguyền của đ&ocirc;i bạn trẻ. Nhưng cả Lila lẫn Aleksei kh&ocirc;ng thể hoặc kh&ocirc;ng muốn cưỡng lại. C&aacute;i c&ograve;n lại vẫn l&agrave; hy vọng. Lila n&oacute;i về nỗi c&ocirc; đơn của m&igrave;nh: &quot;Em đ&atilde; phải mua t&igrave;nh bạn của họ - c&ocirc; g&aacute;i n&oacute;i nhỏ. Con g&aacute;i th&igrave; em trả bằng qu&agrave;, tặng phẩm, con trai th&igrave; em trả bằng l&agrave;m t&igrave;nh, để cho em hết bị c&ocirc; đơn. Để một người n&agrave;o đ&oacute; quan t&acirc;m đến em, một người n&agrave;o đ&oacute; tr&ograve; chuyện với em trong giờ giải lao hoặc sau giờ tan học. Anh Aleksei, anh c&oacute; biết, thế n&agrave;o l&agrave; nỗi c&ocirc; đơn kh&ocirc;ng anh?&quot;.</p>

<p><strong>Hy vọng&nbsp;</strong>l&agrave; t&ecirc;n của cuốn&nbsp;<a href="http://tiki.vn/sach-truyen-tieng-viet/sach-van-hoc.html">tiểu thuyết</a>, cũng l&agrave; t&ecirc;n gọi của ng&ocirc;i nh&agrave; thơ mộng, tọa lạc tr&ecirc;n trảng cỏ, giữa rừng gi&agrave; nguy&ecirc;n sinh, quanh năm r&oacute;c r&aacute;ch tiếng suối chảy, vi vu tiếng th&ocirc;ng reo, l&iacute;u lo tiếng chim h&oacute;t, đẹp như miền cổ t&iacute;ch. Những &aacute;ng văn đẹp, mượt m&agrave;, về c&aacute;nh rừng, về con suối, về &quot;ng&ocirc;i nh&agrave; cổ t&iacute;ch&quot; v&agrave; những b&iacute; ẩn của ng&ocirc;i nh&agrave; n&agrave;y c&ugrave;ng những con người từng sống v&agrave; đang sống trong đ&oacute; khẳng định điều n&agrave;y.</p>

<p>N&eacute;t độc đ&aacute;o của cuốn tiểu thuyết hiện đại nhuốm m&agrave;u cổ t&iacute;ch, l&agrave; ở chỗ, n&oacute; thực đến đau l&ograve;ng v&agrave; rất đời. Bằng những d&ograve;ng hồi tưởng giầu nội t&acirc;m, nữ nh&agrave; văn Katarzyna Michalak kể cho ta nghe c&acirc;u chuyện đầy t&iacute;nh nh&acirc;n văn, x&uacute;c động đến tr&agrave;o nước mắt, về t&igrave;nh bạn v&agrave; t&igrave;nh y&ecirc;u, về giận v&agrave; thương, về l&ograve;ng quả cảm v&agrave; sự hy sinh m&agrave; mỗi người ch&uacute;ng ta đều c&oacute; thể t&igrave;m thấy b&oacute;ng d&aacute;ng cuộc đời m&igrave;nh trong đ&oacute;.</p>

