<p><strong>B&eacute; L&agrave;m Quen M&ocirc;i Trường - Nhạc Cụ</strong></p>

<p>T&ocirc; m&agrave;u l&agrave; h&igrave;nh thức k&iacute;ch th&iacute;ch tr&iacute; tưởng tượng cũng như h&igrave;nh th&agrave;nh tư duy cho c&aacute;c b&eacute; mẫu gi&aacute;o. T&ocirc; m&agrave;u gi&uacute;p c&aacute;c b&eacute; l&agrave;m quen với thế giới m&agrave;u sắc, l&agrave;m quen với sự vật trong đời sống hằng ng&agrave;y qua từng trang giấy.<br />
<br />
Dạy b&eacute; t&ocirc; m&agrave;u l&agrave; một c&aacute;ch để gi&uacute;p b&eacute; thể hiện t&igrave;nh cảm v&agrave; giao lưu với mọi người. Điều quan trọng hơn l&agrave; c&oacute; thể dạy c&aacute;c b&eacute; l&agrave;m quen với h&igrave;nh dạng v&agrave; m&agrave;u sắc, r&egrave;n luyện khả năng động n&atilde;o v&agrave; luyện phối hợp tay của b&eacute;.<br />
<br />
Cuốn s&aacute;ch&nbsp;<strong>B&eacute; L&agrave;m Quen M&ocirc;i Trường - Nhạc Cụ&nbsp;</strong>được bi&ecirc;n soạn d&agrave;nh cho c&aacute;c b&eacute; mẫu gi&aacute;o, v&igrave; vậy t&aacute;c giả ch&uacute; trọng v&agrave;o phần h&igrave;nh vẽ với đường n&eacute;t, mảng khối r&otilde; r&agrave;ng. Điều n&agrave;y sẽ gi&uacute;p c&aacute;c em dễ d&agrave;ng thực hiện thao t&aacute;c t&ocirc; m&agrave;u.<br />
<br />
Mỗi trang t&ocirc; m&agrave;u gồm c&oacute; 2 phần:<br />
<br />
- Phần h&igrave;nh mẫu (in m&agrave;u)<br />
<br />
- Phần h&igrave;nh t&ocirc; với k&iacute;ch thước lớn, đường n&eacute;t r&otilde; r&agrave;ng.<br />
<br />
Ch&uacute;c c&aacute;c em sẽ c&oacute; những gi&acirc;y ph&uacute;t thoải m&aacute;i để ph&aacute;t huy khả năng s&aacute;ng tạo v&agrave; tưởng tượng phong ph&uacute; với cuốn s&aacute;ch th&uacute; vị n&agrave;y nh&eacute;!</p>
', 'be-lam-quen-moi-truong---nhac-cu', 'Product/image_path/55-Nhà-Giả-Kim.jpg', 160000, false, 0, '2017-05-19 09:21:02+00', 1, '2017-05-19 19:21:57+00', 1, false, '{Nhà,Giả,Kim}', '{nha,gia,kim}');

<p>S&aacute;u năm trước, một b&eacute; g&aacute;i sơ sinh bị bắt c&oacute;c tại bệnh viện Ringerika ở Honefoss. S&aacute;u năm sau, một b&eacute; g&aacute;i s&aacute;u tuổi bị treo lơ lửng tr&ecirc;n c&acirc;y bởi sợi d&acirc;y nhảy quanh cổ. C&ocirc; b&eacute; mặc kiểu v&aacute;y b&uacute;p b&ecirc; kỳ lạ. Tr&ecirc;n ngực đeo mảnh giấy ghi d&ograve;ng chữ:&nbsp;<em>T&ocirc;i du h&agrave;nh một m&igrave;nh.</em></p>

<p>Khi đ&oacute;, Mia Kr&uuml;ger, nữ cảnh s&aacute;t điều tra t&agrave;i năng, đang ẩn m&igrave;nh tr&ecirc;n h&ograve;n đảo c&ocirc; lập ngo&agrave;i biển. Đắm ch&igrave;m trong k&yacute; ức buồn đau, c&ocirc; đ&atilde; tự ấn định thời hạn cuộc đời m&igrave;nh. Bất ngờ, Holger Munch xuất hiện, đem theo những bức ảnh. Khi nh&igrave;n thấy số 1 khắc tr&ecirc;n m&oacute;ng tay b&eacute; g&aacute;i, Mia biết đ&acirc;y mới chỉ l&agrave; khởi đầu một chuỗi &aacute;n mạng bi thảm. V&agrave; d&ugrave; kh&ocirc;ng c&ograve;n thiết tha cuộc sống, c&ocirc; nhận lời trở về Oslo, c&ugrave;ng đồng đội đối đầu t&ecirc;n s&aacute;t nh&acirc;n xảo tr&aacute; từng ph&uacute;t gi&acirc;y nghẹt thở&hellip; cho đến tận kết th&uacute;c sững sờ!</p>

<p><a href="http://tiki.vn/sach-truyen-tieng-viet/sach-van-hoc.html">Tiểu thuyết</a>&nbsp;được dịch ra 22 thứ tiếng tr&ecirc;n thế giới, được nhiều tạp ch&iacute; c&oacute; uy t&iacute;n xếp v&agrave;o danh mục s&aacute;ch b&aacute;n chạy của thế giới, đứng đầu danh s&aacute;ch s&aacute;ch b&aacute;n chạy của b&aacute;o Đức&nbsp;<em>Der Spiegel.</em></p>

<p>&ldquo;Nếu đ&acirc;y l&agrave; cuốn tiểu thuyết đầu tay, n&oacute; chẳng kh&aacute;c n&agrave;o một hiện tượng văn chương.&rdquo;</p>

<p>&ndash; Bergens Tirende (Na Uy)</p>

<p>&ldquo;M&ocirc;̣t hơi thở mới trong c&ocirc;̣ng đ&ocirc;̀ng văn học trinh thám đ&ocirc;ng đúc của vùng Scandinavia, cu&ocirc;́n ti&ecirc;̉u thuy&ecirc;́t h&ocirc;̀i h&ocirc;̣p sẽ cu&ocirc;́n h&uacute;t đ&ocirc;̣c gia, khi&ecirc;́n họ n&ocirc;n n&oacute;ng kh&ocirc;ng y&ecirc;n đ&ecirc;́n t&acirc;̣n trang cu&ocirc;́i cùng.&rdquo;</p>

<p>&ndash; Library Journal</p>
