<p>T&ocirc;i sẽ kể một ch&uacute;t về những h&agrave;nh tr&igrave;nh ấy &ndash; những h&agrave;nh tr&igrave;nh sẽ đưa bạn đi giữa b&aacute;t ng&aacute;t hoa cỏ, n&uacute;i rừng, mặt trời, chạy theo những v&ograve;ng quay, những nỗi nhớ biển, những c&acirc;u chuyện kh&ocirc;ng thể l&atilde;ng qu&ecirc;n, v&agrave;&nbsp;<a href="http://tiki.vn/tieu-thuyet-tinh-cam-lang-man/c844">t&igrave;nh y&ecirc;u</a>&nbsp;chưa bao giờ lụi t&agrave;n tr&ecirc;n con đường t&iacute;t tắp&rdquo;.</p>

