<p>Ehon Nhật Bản - Gi&agrave;y Nhỏ Đi Th&ocirc;i</p>

<p>Ehon Nhật Bản c&oacute; đề t&agrave;i rất phong ph&uacute;, từ c&aacute;c sự vật hiện tượng thi&ecirc;n nhi&ecirc;n như c&acirc;y cỏ, hoa l&aacute;, mặt trời, c&aacute;c con vật, cho đến truyện cổ t&iacute;ch, t&igrave;nh cảm gia đ&igrave;nh, t&igrave;nh bạn,... theo c&aacute;c giai đoạn ph&aacute;t triển của trẻ, từ 0 đến 3, từ 3 đến 6 tuổi.&nbsp;Ở Nhật Bản, Ehon được v&iacute; như l&agrave; thực phẩm t&acirc;m hồn của trẻ em, l&agrave; m&oacute;n ăn tinh thần mỗi ng&agrave;y m&agrave; c&aacute;c bậc phụ huynh Nhật, c&aacute;c thầy c&ocirc; ở trường mẫu gi&aacute;o Nhật đều d&agrave;nh cho trẻ. Sở dĩ như vậy, v&igrave; ng&ocirc;n ngữ Ehon trong s&aacute;ng, hồn nhi&ecirc;n; nội dung Ehon phong ph&uacute;; đề t&agrave;i Ehon đa dạng; tranh vẽ minh hoa Ehon tỉ mỉ, s&acirc;u sắc, m&agrave;u sắc h&agrave;i h&ograve;a,... được ph&acirc;n theo từng độ tuổi ph&aacute;t triển của trẻ, để ph&ugrave; hợp với sự tập trung v&agrave; tiếp thu của trẻ ở c&aacute;c giai đoạn kh&aacute;c nhau.</p>

<p>Nhiều cha mẹ quan niệm rằng trẻ nhỏ chưa nhận thức được nội dung truyện? Tuy nhi&ecirc;n, c&aacute;c chuy&ecirc;n gia tr&ecirc;n thế giới khuy&ecirc;n rằng n&ecirc;n đọc truyện cho trẻ nghe c&agrave;ng sớm c&agrave;ng tốt, bởi v&igrave; giai đoạn từ 0 đến 6 l&agrave; giai đoạn v&ocirc; c&ugrave;ng quan trọng để ph&aacute;t triển n&atilde;o bộ của trẻ. C&ugrave;ng con đọc s&aacute;ch sẽ l&agrave; khoảng thời gian để qua đ&oacute; cha mẹ c&oacute; thể k&iacute;ch th&iacute;ch sự ph&aacute;t triển cả năm gi&aacute;c quan cho b&eacute;, tay sờ, mắt nh&igrave;n,&nbsp;tai nghe, miệng &ecirc; a phấn kh&iacute;ch; đọc cho b&eacute; nghe cũng l&agrave; cơ hội tuyệt vời để c&aacute;c bố mẹ gần gũi, &acirc;u yếm v&agrave; gắn kết t&igrave;nh cảm bền chặt với con. Giọng đọc ngọt ng&agrave;o của qu&yacute; vị thực sự sẽ truyền&nbsp;t&igrave;nh y&ecirc;u&nbsp;của qu&yacute; vị đến c&aacute;c con, gi&uacute;p c&aacute;c con cảm nhận được m&igrave;nh được n&acirc;ng niu v&agrave; bao bọc; đồng thời gi&uacute;p c&aacute;c con x&acirc;y dựng vốn từ vựng, ph&aacute;t triển ng&ocirc;n ngữ.</p>
