<p>Con người tr&ecirc;n thế gian n&agrave;y đ&ocirc;ng như vậy, th&aacute;i độ đối với t&igrave;nh cảm chắc chắn kh&ocirc;ng giống nhau. C&oacute; người nghi&ecirc;m t&uacute;c như L&acirc;m Uyển, đương nhi&ecirc;n cũng c&oacute; người kh&ocirc;ng nghi&ecirc;m t&uacute;c như Đ&agrave;m Hy Triết, c&ograve;n đại đa số th&igrave; 50/50. Dĩ nhi&ecirc;n, c&oacute; cả số &iacute;t như Trần K&igrave;nh, bản th&acirc;n cũng kh&ocirc;ng r&otilde; rốt cuộc m&igrave;nh thuộc<ins>&nbsp;</ins>kiểu g&igrave;. Nếu đem so s&aacute;nh, chắc đại đa số mọi người sẽ hạnh ph&uacute;c hơn ch&uacute;t, người như L&acirc;m Uyển l&agrave; đau khổ nhất, người như Đ&agrave;m Hy Triết ư? Sẽ kh&ocirc;ng đau khổ nhưng cũng kh&ocirc;ng hạnh ph&uacute;c. C&ograve;n Trần K&igrave;nh, chỉ c&oacute; thể n&oacute;i, tự tin kh&ocirc;ng bằng tự hiểu.</p>

<p>X&eacute;t cho c&ugrave;ng, một người nếu c&oacute; thể sống hồ đồ th&igrave; cả đời hạnh ph&uacute;c, nếu c&oacute; thể sống s&aacute;ng suốt th&igrave; cả đời cũng c&oacute; thể hạnh ph&uacute;c, nhưng nếu hồ đồ nửa đời rồi chợt s&aacute;ng suốt, hoặc s&aacute;ng suốt nửa đời rồi chợt muốn giả hồ đồ, đ&acirc;y đều l&agrave; sự bất hạnh cực độ.</p>

<p>Cuối c&ugrave;ng, Trần K&igrave;nh hồ đồ hay s&aacute;ng suốt? L&acirc;m Uyển chợt s&aacute;ng suốt hay giả hồ đồ? Liệu con thuyền&nbsp;<a href="http://tiki.vn/tieu-thuyet-tinh-cam-lang-man/c844">t&igrave;nh y&ecirc;u</a>&nbsp;c&oacute; cập bến bờ hạnh ph&uacute;c khi giữa họ đ&atilde; xảy ra bao s&oacute;ng gi&oacute; b&atilde;o gi&ocirc;ng như thế?</p>

